import React, {Component} from 'react';
import Menus from './Menus';
import {Icon, Menu} from "antd";
import {Link} from "react-router-dom";

class ProContent extends React.Component {

    render() {
        return (
            <div>
                <Menu
                    onClick={this.handleClick}
                    style={{ width: 256 }}
                    theme=""
                    defaultSelectedKeys={['1']}
                    mode="inline"
                >

                    <Menu.Item key="commonproblem">
                        <Link to="/commonproblem"><Icon type="question-circle" />
                            常见问题</Link>
                    </Menu.Item>

                    <Menu.Item key="damagedcondition">
                        <Link to="/damagedcondition"><Icon type="tool" />
                            受损状况</Link>
                    </Menu.Item>

                    <Menu.Item key="applyreparations">
                        <Link to="/applyreparations"><Icon type="snippets" />
                            申请理赔</Link>
                    </Menu.Item>

                    <Menu.Item key="claimprogress">
                        <Link to="/claimprogress"><Icon type="hourglass" />
                            理赔进度</Link>
                    </Menu.Item>

                    <Menu.Item key="Claims center">
                        <Link to="/historicalclaims"><Icon type="history" />
                            历史理赔</Link>
                    </Menu.Item>

                </Menu>

            </div>
        );
    }
}

export default ProContent;
